                //  and UnilateralMastectomyDiagnosis.clinicalStatus ~ ToConcept(Global."active") not needed for exclusion
				)
		) LeftMastectomy
				where Global."Normalize Interval"(LeftMastectomy.onset) starts on or before end of "Measurement Period"

